IF OBJECT_ID('dbo.proc_transform_219', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_219;
GO
CREATE PROCEDURE dbo.proc_transform_219
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_219
    SET payload = LEFT(payload, 1000) + N'|V4-219|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_219;
END
